const Footer = () => {
  return (
    <div>
      <div className="text-center">
        <div className="bg-stone-800 bg-bottom bottom-2 inset-0 p-4">
          <h4 className="text-white">Copyright 2022</h4>
        </div>
      </div>
    </div>
  );
};
export default Footer;
